/**
 * Normalizes an emoji by removing variation selectors
 * to improve lookup consistency across different emoji sources
 */
function normalizeEmoji(emoji: string): string {
  // Remove variation selectors (FE0E, FE0F) and zero-width joiners
  // This helps handle cases where the same emoji can be represented differently
  return emoji
    .replace(/\uFE0E/g, '') // Text presentation selector
    .replace(/\uFE0F/g, ''); // Emoji presentation selector
}

/**
 * Gets the color scale for a given emoji.
 * Automatically handles emoji variants (with/without variation selectors).
 * Returns 'gray' as fallback if the emoji is not found.
 *
 * @param emoji - The emoji to get the color for
 * @returns The corresponding ColorScale or 'gray' as fallback
 */
export function getColorForEmoji(emoji: string): ColorScale {
  // Try exact match first
  if (emojiColorMap[emoji]) {
    return emojiColorMap[emoji];
  }

  // Try with emoji presentation selector (FE0F) added
  const withSelector = emoji + '\uFE0F';
  if (emojiColorMap[withSelector]) {
    return emojiColorMap[withSelector];
  }

  // Try with variation selectors removed
  const normalized = normalizeEmoji(emoji);
  if (normalized !== emoji && emojiColorMap[normalized]) {
    return emojiColorMap[normalized];
  }

  // Fallback to gray
  return 'gray';
}
